import React, {useState} from 'react'




export default function Restaurant() {
  const getInitialState = () => {
    const value = "€";
    return value;
  };

  const [value, setValue] = useState(getInitialState);

  const handleChange = (e) => {
    setValue(e.target.value);
  };

     return (
     <div className="resta">
         <label>Name:
            <input type='text'/>
         </label>

         <label>Adress:
            <input type='text'/>
         </label>

         <label>Opening hours:
            <input type='text'/>
         </label>

         <label>Restaurant type:
            <input type='text'/>
         </label>

         <label>
        Price level:
       <div>
       <select value={value} onChange={handleChange}>
        <option value="€">€</option>
        <option value="€€">€€</option>
        <option value="€€€">€€€</option>
        <option value="€€€€">€€€€</option>
      </select>
    </div> 
      </label>
     </div>
       );
     }
